(function ($) {
    "use strict";

        var rtl = $('body').hasClass('rtl'),
            $win = $(window);

        var dir_rtl = (rtl) ? true : false;

     var dahzCarousel = new function() {
         var _this = this,
             _NextPrev;

        // init this
         function run(){

            _NextPrev = $(".related-post .owl-prev, .related-post .owl-next");

                $('.two-col-left #related-slider, .two-col-right #related-slider').owlCarousel({
                    items: 2,
                    rtl:dir_rtl,
                    margin: 15,
                    nav: true,
                    responsive:{ 0:{ items:1 },
                                600:{ items:2 },
                                1000:{ items:3 } },
                    onTranslated: findHeight,
                    navText: [
                        "<i class='df-arrow-grand-left'></i>",
                        "<i class='df-arrow-grand-right'></i>"
                    ]
                });
                $('.one-col #related-slider').owlCarousel({
                    items: 3,
                    rtl:dir_rtl,
                    margin: 15,
                    nav: true,
                    responsive:{ 0:{ items:1 },
                                600:{ items:2 },
                                1000:{ items:3 }
                            },
                    onTranslated: findHeight,
                    navText: [
                        "<i class='df-arrow-grand-left'></i>",
                        "<i class='df-arrow-grand-right'></i>"
                    ]
                });
                $('#editor-pick_slider').owlCarousel({
                    nav: false,
                    rtl:dir_rtl,
                    dots: true,
                    autoPlay: true,
                    onTranslated: findHeight,
                    responsive:{
                                0:{
                                    items:1
                                },
                                600:{
                                    items:2
                                },
                                1000:{
                                    items:3
                                },
                                1200:{
                                    items:4
                                }

                            }
                 });

            $win.load( findHeight ); /*a problem*/
            _NextPrev.click( findHeight );
        }

        // If grab get max height
        function findHeight(){
            var max = -1;
            $('.related-post .owl-item.active, #editor-pick_container .owl-item.active').each(function( i ) {
                var h = $(this).height();
                max = h > max ? h : max;
            });
            $('.related-post .owl-stage-outer, #editor-pick_container .owl-stage-outer').css('height', max);
        }

        run();
    };

})(jQuery);

// Rating
(function ($) {
	$('#rate-product .df-rating-star').on( 'click', function(event){
  		if( event.target.tagName === "INPUT" ) {
			rate_status = $('.df-rating-star input[name=rating]:checked').val()

			$('#selected_rating').attr('value',rate_status);

			var options = {
			        target:        '#output',   // target element(s) to be updated with server response
			        beforeSubmit:  function(){},  // pre-submit callback
			        success:       function(){
													$('#rate-product').fadeOut('slow',function(){
														$('#output').fadeIn('slow');
													});
											}
			    };

			$('#rate-product').ajaxSubmit(options);
   		}
	});

})(jQuery);


(function ($) {
    "use strict";

var animateHeaderSearch = new function() {

    function run(){

    change();

	jQuery(".top-search").click(elemAnimDown);

         $(document).keyup(function(e) {
            if (e.keyCode == 27) {
                e.preventDefault();
                jQuery(".universe-search").fadeOut(300);
            }   // esc
        });
         jQuery(".universe-search-close, .container-search-close").click(function(e) {
        // Prevent default behaviour
            e.preventDefault();
            jQuery(".universe-search").fadeOut(300);
        });

        $(".mobile-ajax-category").click(function(e) {
            if ($('.ajax-search-select-text').css('display') == 'block') {
                $(".mobile-ajax-category").removeClass('ajax-category-active');
            } else{
                $(".mobile-ajax-category").addClass('ajax-category-active');
            }
            // Prevent default behaviour
            e.preventDefault();
            jQuery(".ajax-search-select-text").fadeToggle('fast');
        });
    }


    function elemAnimDown(){
        jQuery(".universe-search").fadeIn(300).css('display','block');
        jQuery(".universe-search-form .universe-search-input").focus();
    }


    function change(){

         $('#searchfrm').keypress(function(e) {
            var value = $(this).val();
            var lenght = value.length;
            if(lenght > 1 && e.keyCode == 13) {
               var str_cat = '',  str_tag = '',  str_cal = '';
                str_cat += $( '#cat_select option:selected' ).val() + " ";
                str_cal += $( '#cal_select option:selected' ).val() + " ";
                str_tag += $( '#tag_select option:selected' ).val() + " ";

                $.post(ajaxurl, { action: 'ajax_search', s: value, cat_select : str_cat, tag_select : str_tag, calendar_select: str_cal }, function(output) {
                    $('.universe-search-results').html(output);
                });
            }
            jsp_init();
        });

        $('#cat_select').change(function() {
            jsp_init();
             var str_cat = '', str_tag = '', value = '', str_cal = '', text_category = '';
           $( "#cat_select option:selected" ).each(function() {
                str_cat += $( this ).val() + " ";
                text_category += $( this ).text();
                str_cal += $( '#cal_select option:selected' ).val() + " ";
                str_tag += $( '#tag_select option:selected' ).val() + " ";
                value +=  $("#searchfrm").val() + " ";

                $('.df-category-text').text(text_category);

                $.post(ajaxurl, { action: 'ajax_search', s: value, cat_select : str_cat, tag_select : str_tag, calendar_select: str_cal }, function(output) {
                    $('.universe-search-results').html(output);
                });
            });

        });

        $('#tag_select').change(function() {
            jsp_init();
             var str_cat = '', str_tag = '', value = '', str_cal = '', text_tag = '';
           $( "#tag_select option:selected" ).each(function() {
                str_tag += $( this ).val() + " ";
                text_tag += $( this ).text() + " ";
                str_cat += $( '#cat_select option:selected' ).val() + " ";
                str_cal += $( '#cal_select option:selected' ).val() + " ";
                value +=  $("#searchfrm").val() + " ";

                $('.df-tag-text').text(text_tag);

                $.post(ajaxurl, { action: 'ajax_search', s: value, cat_select : str_cat, tag_select : str_tag, calendar_select: str_cal }, function(output) {
                    $('.universe-search-results').html(output);
                });

            });
        });

        $('#cal_select').change(function() {
            jsp_init();
             var str_cat = '', str_tag = '', value = '', str_cal = '', text_calendar = '';
           $( "#cal_select option:selected" ).each(function() {
                str_cal += $( this ).val() + " ";
                text_calendar += $( this ).text() + " ";
                str_tag += $( '#tag_select option:selected' ).val() + " ";
                str_cat += $( '#cat_select option:selected' ).val() + " ";
                value +=  $("#searchfrm").val() + " ";

                $('.df-calendar-text').text(text_calendar);

                $.post(ajaxurl, { action: 'ajax_search', s: value, cat_select : str_cat, tag_select : str_tag, calendar_select: str_cal  }, function(output) {
                    $('.universe-search-results').html(output);
                });

            });
        });

    }

    function jsp_init(){

        var containerJsp = jQuery('#jp-container-search'),
         window_height= $(window).height();
        var jsp_height = window_height - 310 - 44;

        if (dfGlobals.isAndroid) {
            var jsp_height = window_height - 91 - 44;
            jsp_height = jsp_height + 250;
        }
        containerJsp.css('height', jsp_height);
        // the element we want to apply the jScrollPane
        $('#jp-container-search').jScrollPane({
            autoReinitialise: true,
        });

    }

    run();

    };

})(jQuery);


(function($){

dahzMasonry = {


   init: function(){
   var Main = $('.df-main'),
   _gridFit = Main.find('.df_grid_fit'),
   _gridMasonry = Main.find('.df_grid_masonry');


        if( _gridFit.length ){

        var mycontainer = $('.df_grid_fit');
        dahzMasonry.gridFit();
    	mycontainer.imagesLoaded( function() {
              mycontainer.isotope('layout');
            });

        } else if( _gridMasonry.length ) {

        var mycontainer = $('.df_grid_masonry');
        dahzMasonry.gridMasonry();
            mycontainer.imagesLoaded( function() {
              mycontainer.isotope('layout');
            });

        }

            var $links = $('#options-blog-sort a');
            $links.click(dahzMasonry.filterAdd);

            $links.click(function() {
            $links.removeClass('current').addClass('link');
            jQuery(this).removeClass('link').addClass('current');

               var divname = this.name;
               $("#" + divname).show("normal").siblings().hide("normal");
            });
    },

    gridFit: function (){

        $('.df_grid_fit').isotope({
            itemSelector: '.post',
            layoutMode: 'fitRows',
        });
    },

    gridMasonry: function(){

        $( '.df_grid_masonry' ).prepend( "<div class='grid-sizer'></div>" );
        $('.df_grid_masonry').isotope({
            itemSelector: '.post',
            masonry: {
                columnWidth: ".grid-sizer",
                layoutMode: 'masonry',

            }
        });

    },

    filterAdd: function(){

    	  var Main = $('.df-main'),
		   _gridFit = Main.find('.df_grid_fit'),
		   _gridMasonry = Main.find('.df_grid_masonry');

            var selector = jQuery(this).attr('data-filter');
            if( _gridFit.length ){
            $('.df_grid_fit').not('.shorcode-blog-banner').isotope({filter: selector});
            } else if( _gridMasonry.length ){
            $('.df_grid_masonry').isotope({filter: selector});
            }
            return false;

    }


    };


})(jQuery);


